import React from "react";
import { Link } from 'react-router-dom';

function Home() {
   return (
      <div>
         <button><Link to="/login">Login!</Link></button>
         <button><Link to="/signup">Sign Up!</Link></button>
         <button><Link to="/search">Continue as Guest!</Link></button>
      </div>
   );
}

export default Home;
